import "../App.css";

const Body = () => {
    return(
    <div>
        <label for="pet-select">Choose a pet:</label>

        <div className="imgCard">
            <h1>고양이</h1>
            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/3/3a/Cat03.jpg/1200px-Cat03.jpg" alt=""></img>

            <h1>강아지</h1>
            <img src="https://cdn.crowdpic.net/detail-thumb/thumb_d_382A8A747FFDF073E20C13398D110DE7.jpg" alt=""></img>

        </div>

        <a class="btn btn-default" href="#" role="button">Link</a>
        <button class="btn btn-default" type="submit">Button</button>

    </div>
    );
}



export default Body;
